Alles kan gebeuren op Nim's Island, een magische plek die beheerst wordt door de gedachten van een meisje, Nim. Een wereld die gespiegeld is aan haar favoriete boekpersonage, Alex Rover, 's werelds grootste avonturier. Maar de schrijfster van de boeken, Alexandra, leeft gewoon een eenzaam bestaan in de grote stad. Wanneer Nim's vader vermist wordt, brengt een serie gebeurtenissen Nim bij Alexandra en moeten ze moed ontlenen aan Alex Rover om Nim's eiland te doorkruisen.:
